import { createGlobalStyle } from "styled-components";


const StyleGlobal = createGlobalStyle`
      *{
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: Arial, Helvetica, sans-serif;
        }
`
export default StyleGlobal
